import {
    pageName,
    isDarkmode,
    isFirstVisit,
    organizationId,
    isSkeltonLoading,
} from "./atom";
import {
    withPageName,
    withIsDarkMod,
    withIsFirstVisit,
    withOrganizationId,
    withIsSkeltonLoading,
} from "./withGlobalSelectors";

export {
    pageName,
    isDarkmode,
    withPageName,
    isFirstVisit,
    withIsDarkMod,
    organizationId,
    isSkeltonLoading,
    withIsFirstVisit,
    withOrganizationId,
    withIsSkeltonLoading,
};
